import Cart from "../components/Cart";

const CartPage = () => {
  const cartItems = []; // Replace with state or Redux store

  return (
    <div>
      <h1>Shopping Cart</h1>
      <Cart items={cartItems} />
    </div>
  );
};

export default CartPage;
